  /**
   *  Emit the given instruction, assuming that
   * it is a MIR_Nullary instruction
   * and has a FLDLN2 operator
   *
   * @param inst the instruction to assemble
   */
  private void doFLDLN2(Instruction inst) {
    if (VM.VerifyAssertions && !isFPR_Reg(MIR_Nullary.getResult(inst))) VM._assert(VM.NOT_REACHED, inst.toString());
    emitFLDLN2_Reg(
      getFPR_Reg(MIR_Nullary.getResult(inst)));
  }

